function checker(name)
{
	currentName = $('#'+name).attr('id');
	currentString = currentName.split('_');
	$('#'+name).closest('tr').find('.css-checkbox').prop('checked', false); 
	for(i=1;i<=currentString[1];i++)
	{
		$('#'+currentString[0]+'_'+i).prop('checked', true);
	}	
}
function checker_square(name)
{
	currentName = $('#'+name).attr('id');
	currentString = currentName.split('_');
	$('#'+name).closest('tr').find('.css-checkbox-square').prop('checked', false); 
	for(i=0;i<=currentString[1];i++)
	{
		$('#'+currentString[0]+'_'+i).prop('checked', true);
	}	
}

checker('resolution_<?php echo $crmDetails['customer_resolution'];?>');
</script>
